import React from 'react';
// import './Footer.css'; // Create CSS file for styling

const Footer = () => {
    return (
        <footer>
            <p>&copy; 2024 Prama Neszhua Hoshe</p>
            <div>
                <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer">GitHub</a>
                <a href="https://linkedin.com/in/pramaneszhuahoshe" target="_blank" rel="noopener noreferrer">LinkedIn</a>
            </div>
        </footer>
    );
};

export default Footer;
